import React, { Component } from 'react'
import "./side_bar.css"

export default class Side_bar extends Component {
  render() {
    return (
      <div className='side_Bar'>
        <div id="logo">
            <img src={require("./Logo.png")} alt="N/A" />
        </div>
        <button type="button" id="side_bt">
            <img src={require("../side.png")} alt="N/A" />
        </button>
      </div>
    )
  }
}
